import React, { useEffect } from "react";
import { getEmployees } from "./actions/employees";
import { getToken } from "./actions/token";
import { getTeams } from "./actions/teams";
import { getAlliances } from "./actions/alliances";
import { useDispatch } from "react-redux";
import { HTML5Backend } from "react-dnd-html5-backend";
import { DndProvider } from "react-dnd";
import DragDrop from "./components/DragDrop";
import "./styles/App.css";

function App() {
  const dispatch = useDispatch();

  useEffect(async () => {
    try {
      const token = await dispatch(getToken());
      const employees = await dispatch(getEmployees());
      const teams = await dispatch(getTeams());
      const alliances = await dispatch(getAlliances());
    } catch (err) {
      console.log(err);
    }
  }, [dispatch]);
  const Swiper = new Swiper(".swiper-container", {
    loop: true,
    lazy: {
      loadPrevNext: true,
    },
    pagination: {
      el: ".swiper-pagination",
      clickable: true,
    },
    navigation: {
      nextEl: ".swiper-button-next",
      prevEl: ".swiper-button-prev",
    },
  });
  return (
    <div>
      <div class="swiper-container">
        <div class="swiper-wrapper">
          <div class="swiper-slide">
            <img
              data-src="https://picsum.photos/id/81/200"
              class="swiper-lazy"
            ></img>
            <div class="swiper-lazy-preloader"></div>
          </div>
          <div class="swiper-slide">
            <img
              data-src="https://picsum.photos/id/82/200"
              class="swiper-lazy"
            ></img>
            <div class="swiper-lazy-preloader"></div>
          </div>
          <div class="swiper-slide">
            <img
              data-src="https://picsum.photos/id/83/200"
              class="swiper-lazy"
            ></img>
            <div class="swiper-lazy-preloader"></div>
          </div>
          <div class="swiper-slide">
            <img
              data-src="https://picsum.photos/id/84/200"
              class="swiper-lazy"
            ></img>
            <div class="swiper-lazy-preloader"></div>
          </div>
          <div class="swiper-slide">
            <img
              data-src="https://picsum.photos/id/95/200"
              class="swiper-lazy"
            ></img>
            <div class="swiper-lazy-preloader"></div>
          </div>
        </div>
        <div class="swiper-pagination"></div>
        <div class="swiper-button-next"></div>
        <div class="swiper-button-prev"></div>
      </div>
    </div>
  );
}

export default App;
